INSERT INTO `yazilar` (`id`, `kullanici_id`, `dizi_film_ad`, `baslik`, `tur`, `yazi_icerik`, `begeni_sayisi`, `tarih`, `resim`, `begenenler`, `inceleme`, `tarih_val`, `inceleyenler`, `puan`, `kullanici_ad`, `tur_populer`) VALUES
(5, 13, 'Breaking Bad', 'Efsanelerden kim kaldı', 'dizi', '<p>Bir daha&nbsp;<strong>asla&nbsp;</strong>yerini dolduramayacak bir dizi... Efsanelerden, sadece kurgusu değil oyuncuların bu kadar i&ccedil;ten oynaması bile bu diziyi harika kılıyor</p>\r\n<p>&nbsp;</p>', 0, '09 Ocak, 2020 saat 18:49', 'tmp_resimler/41bcfd9ab658ebaac1661f58080aad6b.jpg', '0', 1, '2020-01-13 00:28:33', '0-13', 0, 'Lepuz', 0),
(8, 13, 'Fight Club', 'Hayatımda Gerçekten İzlediğim En İyisi', 'film', '<p>&Ouml;ncelikle &ccedil;ok karmaşık bir film olmakla beraber hi&ccedil; de karmaşık&nbsp;<strong>olmadığını&nbsp;</strong>s&ouml;ylemek istiyorum.Evet film &ccedil;ok g&uuml;zel buna kesinlikle hi&ccedil; lafım yok fakat bir o kadar da eksiklikleri olduğunu belirtmek istiyorum.</p>\r\n<ol>\r\n<li>Tutarsızlık</li>\r\n<li>Belirsizlik</li>\r\n<li>Anlamsızlık</li>\r\n<li>Neden ? Neden ?</li>\r\n</ol>\r\n<p>Evet eksiklikleri bu kadar.İyi olan &ouml;zellikleri saymaya &ccedil;alışırsam sanırsam 100\'den fazla &ouml;zellik yazabilirim.</p>', 0, '10 Ocak, 2020 saat 14:28', '', '0', 2, '2020-11-01-17-42', '0-13', 0, 'Lepuz', 1),
(9, 13, 'DARK', 'KARIŞIK', 'dizi', '<p>Evet başlığı karışık yaptım &ccedil;&uuml;nk&uuml; &ouml;yle &ccedil;ok ama &ccedil;ok&nbsp;<strong>karışık</strong> hala kafamda deli sorular var.</p>', 0, '10 Ocak, 2020 saat 14:30', '', '0', 1, '2020-01-13 00:28:33', '0-13', 0, 'Lepuz', 0),
(10, 16, 'The Lord of the Rings', 'Efsanelerden kim kaldı ', 'film', '<p>Ger&ccedil;ekten Efsanelerden kim kaldı.<em>Y&uuml;z&uuml;klerin Efendisi gibi bir film hala &ccedil;ıkmadı ve kesinlikle &ccedil;ıkmayacak da.Hayır&nbsp;<strong>&Ccedil;IKAMAZ DA</strong></em></p>', 0, '10 Ocak, 2020 saat 14:33', '', '0', 2, '2020-11-01-17-42', '0-13-16', 0, 'mirayyugur', 1),
(13, 13, 'Recep İvedik 4', 'İğrenç', 'film', '<p>İğren&ccedil; Yazınıza başlayın&nbsp; İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın İğren&ccedil; Yazınıza başlayın&nbsp;</p>', 2, '10 Ocak, 2020 saat 16:10', '', '0-15-13', 3, '2020-11-01-17-42', '0-13-16', 0, 'Lepuz', 1),
(14, 13, 'La casa de papel', 'Harika bir dizi', 'dizi', '<p>Son zamanlar seyrettiğim&nbsp;<strong>en g&uuml;zel&nbsp;</strong>dizilerden bir tanesi ve uzun s&uuml;rede b&ouml;yle bir dizi seyredeciğimi zannetmiyorum 4 Nisana kadar</p>\r\n<p>&nbsp;</p>', 1, '11 Ocak, 2020 saat 00:36', 'tmp_resimler/e3b0ab92511ce1f46960bed57f65f532.jpg', '0-13', 2, '2020-01-13 00:28:33', '0-13', 0, 'Lepuz', 0),
(16, 13, 'Gerald s Game', 'ruh halini etkileyen bir film...', 'film', '<p>ilk izlediğinizde &ccedil;ok durgun gelebilir hatta sonrasında da durgun gelebilir fakat enteresan bir s&uuml;r&uuml;kleyiciliği var sıkılsanız da izlemek istiyosunuz merak uyanıdrıyor yani sonunda &ccedil;ok şaşırmıyosunuz waoww olmuyosunuz yani ama entersan yani izleyin bay&nbsp;</p>', 2, '11 Ocak, 2020 saat 22:43', '', '0-16-13', 2, '2020-11-01-17-42', '0-13-16', 0, 'Lepuz', 1),
