(28, 13, 'Sherlock', 'Efsanelerden biridir', 'dizi', '<p>Sherlock dizisi ger&ccedil;ekten unutulamayacak dizilerden birisidir.Sadece g&uuml;zel değil aynı zamanda harika olan bir dizi.Oyuncuların muhteşem oyunculukları, kurgunun harika yazılmış olması, her zaman merak ettiren senaryosu...</p>\r\n<p><strong>Kimler izlemeli ?</strong></p>\r\n<p>Polisiye severlerin mutlaka izlemesi gerektiğini (Polisiye severler listesine Lucifer\'ı katmadığımı belirtmek istiyorum, neden olduğuna daha sonraki yazımda bahsedeceğim) soluksuz bir şekilde bitirebileceklerinin garantisini verebilirim.</p>\r\n<p>&nbsp;</p>', 1, '13 Ocak, 2020 saat 19:23', '', '0-13', 2, '2020-01-13 19:23:48', '0-13', 0, 'Lepuz', 1),
