(35, 13, 'Titans', 'Ağırdan alınarak izlenir..', 'dizi', '<p>Titans\'ın &ccedil;ıkacağını duyduğumda &ccedil;ok heyecanlanmıştım.Her zamanki gibi netflix\'in yeni bir dizisiydi bu y&uuml;zden her yerde reklamı vardı ve &ccedil;ok hypelanıyordu.Dizi &ccedil;ıktı Robin, Batman\'ı izlemek i&ccedil;in sabırsızlıkla bekliyordum.Vee pek de beklediğim gibi olduğunu s&ouml;ylemem.Batman\'i 1 sezon boyunca saklayıp batman\'e hi&ccedil; yakışmayan bir oyuncuyu oynatmaları&nbsp;<strong>fiyasko..&nbsp;</strong>G&ouml;n&uuml;l rahatlığıyla robin\'in k&ouml;t&uuml; adamları pataklamasını izleyemedik.</p>\r\n<h1>1.Sezon</h1>\r\n<p>1 Sezon boyunca kuzgun da kuzgun, kıyamet de kıyamet diye sezonu izledik.Sonunda ne oldu Rachel 10 saniyede babasını &ouml;ld&uuml;rd&uuml; ve&nbsp;<strong>mutlu son....</strong> H&uuml;sran bir bitişti ger&ccedil;ekten de.Sanki yazar sonunu getirmek i&ccedil;in acele etmiş gibi bir havası vardı finalin.Sırf bu y&uuml;zden 2.sezona başlamayı d&uuml;ş&uuml;nmedim fakat kendimi tutamayıp başladımm.</p>\r\n<h1>2.Sezon</h1>\r\n<p>Meh.. En azından bir şeyleri oturtmaya &ccedil;alışmışlar fakat yine de &ccedil;ok eksiklikleri var.Titans dizisinin d&uuml;zeltmesi, tamamlaması gereken &ccedil;ok ama &ccedil;ook eksiği var maalesef.</p>\r\n<h1><strong>İzlemeli miyim ?</strong></h1>\r\n<p>Dc\'yi seviyorum ve dc i&ccedil;in her şeyimi veririmler kesinlikle izlesin.</p>\r\n<p>Dc\'yi seviyorum ama olmasa da olurcular dizileri kalmadıysa başlayabilirler</p>\r\n<p>Marvel taraftarıyım diyenler, boşver izlemeyin</p>\r\n<p>Ben takım tutmuyorum ama b&ouml;yle filmleri izlerimciler, hi&ccedil; başlamayın &ccedil;ook daha g&uuml;zel diziler var.</p>', 1, '15 Ocak, 2020 saat 19:48', 'tmp_resimler/96629f1aac6ddb7a7cfa82574b6722d4.jpg', '0-13', 3, '2020-01-15 19:48:35', '0-13-16', 3, 'Lepuz', 1),
