(47, 13, 'Sex Education', 'Tam kafa dağıtmalık bir dizi', 'dizi', '<p>Dizinin ilk &ccedil;ıktığı zamanda herkesin izlediğini duymuştum ve isminden anlaşılacağı gibi direk \"Ergen dizisi\" olarak d&uuml;ş&uuml;nd&uuml;m.&Ccedil;ok &ouml;nyargılı yaklaşmıştım biliyorum.1 sene sabrettikten sonra izlemeye karar verdim(İzleyecek başka bir dizim de kalmamıştı).Ve &ouml;nyargılarım her zamanki gibi yanılmış beklediğimden kat ve kat daha iyi bir diziydi.Tabiki de &ouml;nyargılarım tamamen de yanılmamıştı, tam bir&nbsp;<strong>ergen dizisiydi</strong> ama ergen olmasan da değişik bir şekilde insanı sarıyor ve izleyesesin geliyordu.İzledik&ccedil;e merak ediyor hatta eş&ccedil;insellerin bile aşk hikayelerinin sonucunu merak ediyor duygulanıyordum.Diziyi ger&ccedil;ekten de sevdim.Fakat 1. sezon ile 2. sezon ayrı ayrı ele alındığında hoşuma gitmeyen &ccedil;ok fazla şeyin olduğunu rahatlıkla s&ouml;yleyebilirim.</p>\r\n<span style=\" display: block;\r\n  font-size: 2.5rem;\r\n  margin-bottom: .5rem;\r\n    font-family: inherit;\r\n    font-weight: 500;\r\n    line-height: 1.2;\r\n    color: inherit;\">1.Sezon</span>\r\n<p>Evet.. 1.sezon, her netflix dizisinde olduğu gibi &ccedil;ok hızlı başlayan bir sezondu.Karakterler bize direk tanıldı, konunun temelinde&nbsp;<strong>SEX&nbsp;</strong>olduğu a&ccedil;ık&ccedil;a bize belirtildi ve karakterler bize sevdirildi.Peki neden netflix\'in her dizisi gibi bu dizi de sezonunun yarısında yavaşlamıştı.İzlerken merak ettiğim devam ediyor fakat kimi zaman off.. hadi ama diyordum.Aynı zamanda 1.sezonda&nbsp;<em>otis&nbsp;</em>sağolsun bolcana cringe duygusunu da yaşatıyor bize 1.sezon.Neticede 8 b&ouml;l&uuml;ml&uuml;k hevesimizi kursağımızda bırakan yine de izlemesi keyifli olan bir sezondu.</p>\r\n<span style=\" display: block;\r\n  font-size: 2.5rem;\r\n  margin-bottom: .5rem;\r\n    font-family: inherit;\r\n    font-weight: 500;\r\n    line-height: 1.2;\r\n    color: inherit;\">2.Sezon</span>\r\n<p>2.sezon ise 1. sezondan &ccedil;ok 